import axios from "axios";

export const getLog = () => {
  return new Promise((resolve, reject) => {
    const user =
      // axios.get("http://jsonplaceholder.typicode.com/users");
      /*
    +....finjo retardo en a peticion a la api, ademas
    la idea es que una vez respondida la peticion que seria un token de validacion
    dispare el estado (!log), en este caso esta funcion devuelve la negacion de un
    estado de log.
    +...esta funcion de poder escuchar al STORE
    */
      setTimeout(() => {
        const logStatus = {
          name: "nombreLogueado",
          username: "usernameLogueado",
          log: true,
        };
        return logStatus;
      }, 2000);

    resolve(user.data);
    console.log(user.logStatus);
    reject(new Error("failed to add user"));
  });
};
